window.bookSummaryJSON = "<p><b>An Atlan warlord in mating fever with two choices:</b></p> <p>Be the latest bachelor beast on an Earth reality television show to find his perfect mate or face certain death in an Atlan prison. Braun’s not sure which is worse...until a female enters his hotel suite with towels and cleaning supplies.</p> <p>She isn’t part of the television show. She isn’t available. She isn’t interested in mating with an alien. She isn’t <i>his.</i></p> <p>Try telling that to his beast, because one look at the maid and Braun knows he will do anything...<i>anything,</i> to claim her.</p>"; 
